// src/pages/Home.js
import React from 'react';
import Main from '../components/Main';
import FeatureSection from '../components/FeatureSection';

const Home = () => {
  return (
    <div>
      {/* Main panel at the top */}
      <Main />

      {/* Feature section below the main panel */}
      <FeatureSection />
    </div>
  );
};

export default Home;
